  [],\n\t\"num_tags\": 0,\n\t\"name\": \"mosaic-of-5m-gridded-multibeam-bathymetry-and-bathymetry-derived-from-multispectral-world-view-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded multibeam bathymetry is integrated
  with bathymetry derived from multpectral World View-2 satellite data. Gridded (5
  m cell size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i and R/V
  AHI. Bathymetry values shallower than ~20 m were derived by gauging the reletive
  attenuation of coastal, blue, green and yellow spectral radiance as a function of
  depth. A multiple linear regression analysis of coastal,blue, green and yellow band
  spectral values against depth determined the variables of y-intercept, coastal,blue,
  green and yellow slope values. Variables then used in multivariate slope intercept
  formula to derive depth. Digital image processing to derive depths conducted with
  the ENVI 4.8 software program while data editing and integration was performed using
  ArcGIS 10. This data set is for the shelf environment of Swains Island, Territory
  of American Samoa.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
